// src/index.js

import React from "react";
import ReactDOM from "react-dom/client";
import socket from "./socket";
import App from "./App";
window.socket = socket;
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
